  false,\n\t\"url\": null,\n\t\"notes\": \"The TIGER/Line shapefiles and related database
  files (.dbf) are an extract of selected geographic and cartographic information
  from the U.S. Census Bureau's Master Address File / Topologically Integrated Geographic
  Encoding and Referencing (MAF/TIGER) Database (MTDB).  The MTDB represents a seamless
  national file with no overlaps or gaps between parts, however, each TIGER/Line shapefile
  is designed to stand alone as an independent data set, or they can be combined to
  cover the entire nation.nnnCounty subdivisions are the primary divisions of counties
  and their equivalent entities for the reporting of Census Bureau data. They include
  legally-recognized minor civil divisions (MCDs) and statistical census county divisions
  (CCDs), and unorganized territories.  For the 2010 Census, the MCDs are the primary
  governmental and/or administrative divisions of counties in 29 States and Puerto
  Rico; Tennessee changed from having CCDs for Census 2000 to having MCDs for the
  2010 Census.  In MCD States where no MCD exists or is not defined, the Census Bureau
  creates statistical unorganized territories to complete coverage.  The entire area
  of the United States, Puerto Rico, and the Island Areas are covered by county subdivisions.
  \ The boundaries of most legal MCDs are as of January 1, 2015, as reported through
  the Census Bureau's Boundary and Annexation Survey (BAS).  nnnThe boundaries of
  all CCDs, delineated in 20 states, are those as reported as part of the Census Bureau's
  Participant Statistical Areas Program (PSAP) for the 2010 Census.n\",\n\t\"license_title\":
